def delete_relation_in_synset(synset,relation,wordnetfile):
        de_wn = open(wordnetfile,"r",encoding="utf-8")
        lines = de_wn.readlines()
        de_wn.close()
        out_odenet = open(wordnetfile,"w",encoding="utf-8")
        ss_string = '<Synset id="' + synset + '"'
        for line in lines:
            if ss_string in line and relation in line:
                line=re.sub(relation,'',line)
                line = correct_synset(line)
                print(line)
            out_odenet.write(line)
        out_odenet.close()


# Ein Beispiel einfügen

def add_example_to_ss(synset,example, wordnetfile):
        de_wn = open(wordnetfile,"r",encoding="utf-8")
        lines = de_wn.readlines()
        de_wn.close()
        out_odenet = open(wordnetfile,"w",encoding="utf-8")
        ss_string = '<Synset id="' + synset + '"'
        example_string = "<Example>" + example + "</Example>"
        for line in lines:
            if ss_string in line and "<Example>" not in line:
                if '</Synset>' in line:
                    line = line.replace('</Synset>', example_string + '</Synset>')
                print(line)
            out_odenet.write(line)
        out_odenet.close()

#### POS ändern: Das erfordert multiple Änderungen

# für das Synset, für die Synset ID, für alle Wörter im Synset und für die Sense-IDs

# Änderung der Synset-ID

def change_synset_id_pos(synset,pos,wordnetfile):
        de_wn = open(wordnetfile,"r",encoding="utf-8")
        lines = de_wn.readlines()
        de_wn.close()
        out_odenet = open(wordnetfile,"w",encoding="utf-8")
        sense_id_string = '_' + synset[7:]
        new_sense_id_string = '_' + synset[7:-1] + pos
        new_synset = synset[:-1] + pos
        for line in lines:
            if synset in line:
                line = line.replace(synset,new_synset)
                line = line.replace(sense_id_string,new_sense_id_string)
            out_odenet.write(line)
        out_odenet.close()

# Änderung des POS in einem LexEntry

def change_pos_in_lexentry(lemma,pos,wordnetfile):
        de_wn = open(wordnetfile,"r",encoding="utf-8")
        lines = de_wn.readlines()
        de_wn.close()
        out_odenet = open(wordnetfile,"w",encoding="utf-8")
        lemma_string = 'Lemma writtenForm="' + lemma + '"'
        for line in lines:
            if lemma_string in line:
#                print(line)
                line = re.sub("partOfSpeech" + '="[a-z]"', "partOfSpeech" + '="'+ pos +'"', line)
#                print(line)
            out_odenet.write(line)
        out_odenet.close()
 
# Änderung des POS für ein Synset, mit allen Implikationen

def change_pos(synset,pos,wordnetfile):
        change_attribute_in_ss(synset,"partOfSpeech",pos,wordnetfile)
        words = words_in_synset(synset)
        for lemma in words:
            change_pos_in_lexentry(lemma,pos,wordnetfile)
        change_synset_id_pos(synset,pos,wordnetfile)


# Die Version ohne Zeilenumbruch als Pretty Print speichern

def prettyprint_odenet():
    oneline_odenet = open(r"odenet_oneline.xml","r", encoding="utf-8")
    lines = oneline_odenet.readlines()
    oneline_odenet.close()
    pretty_odenet = open(de_wn_file,"w",encoding="utf-8")
    for line in lines:
        line = line.replace("<Lemma","\n\t<Lemma")
        line = line.replace("<Sense","\n\t<Sense")
        line = line.replace("</Sense","\n\t</Sense")
        line = line.replace("</LexicalEntry>","\n</LexicalEntry>")
        line = line.replace("<SynsetRelation","\n\t<SynsetRelation")
        line = line.replace("<Definition>","\n\t<Definition>")
        line = line.replace("<Example>","\n\t<Example>")
        line = line.replace("</Synset>","\n</Synset>")
        line = line.replace("<SyntacticBehaviour","\n\t<SyntacticBehaviour")
        pretty_odenet.write(line)
    pretty_odenet.close()



    

